import React from 'react';
import './App.css';
import Person from './person/Person';

function App() {
    return (
        <div className="App">
            <h1>hey welcome</h1>
            <Person name='john' age='40'/>
            <Person name='joe' age='50'/>
            <Person name='doe' age='60'/>
        </div>
    );
}

export default App;
